import React from "react";
import styled from "styled-components";
import cookie from "react-cookies";
import { NavLink as Link } from "react-router-dom";
import {
  contentList,
  personalList,
  moreList,
  settingList,
} from "../../../data/sideBarData";
import logo from "../../../assets/images/youtube.png";
import hamburger from "../../../assets/images/hamburger.png";

const Container = styled.div`
  width: 240px;
  height: 100%;
  padding: 0 16px;
  position: absolute;
  left: 0;
  background-color: white;
`;
const TitleBox = styled.div`
  width: 240px;
  height: 56px;
  display: flex;
`;
const TitleImage = styled.img`
  width: 97px;
  height: 24px;
  padding: 18px 14px 18px 16px;
`;
const TitleImage2 = styled.img`
  width: 26px;
  height: 26px;
  padding: 18px 8px 18px 8px;
`;
const ContentBox = styled.div``;
const Content = styled.div`
  display: flex;
  align-items: center;
  width: 240px;
  height: 40px;
`;
const ContentImg = styled.icon`
  width: 24px;
  height: 24px;
  padding: 8px;
  margin-right: 8px;
  cursor: pointer;
`;
const ContentText = styled.p``;

function sideBar() {
  return (
    <Container>
      <TitleBox>
        <TitleImage2 src={hamburger} />
        <Link to="/">
          <TitleImage src={logo} />
        </Link>
      </TitleBox>
      <ContentBox>
        {contentList.map((c) => (
          <Content>
            <ContentImg />
            <ContentText>{c.text}</ContentText>
          </Content>
        ))}
      </ContentBox>
      <ContentBox>
        {personalList.map((p) => (
          <Content>
            <ContentImg />
            <ContentText>{p.text}</ContentText>
          </Content>
        ))}
      </ContentBox>
      <ContentBox>
        {moreList.map((m) => (
          <Content>
            <ContentImg />
            <ContentText>{m.text}</ContentText>
          </Content>
        ))}
      </ContentBox>
      <ContentBox>
        {settingList.map((s) => (
          <Content>
            <ContentImg />
            <ContentText>{s.text}</ContentText>
          </Content>
        ))}
      </ContentBox>
    </Container>
  );
}

export default sideBar;
